import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props)
   {
    super(props);
    this.state = {name: "Jahi", count: 0};
    this.main = this.main.bind(this);
  }

  main()
  {
    for(var i=0; i<100; i++)
    {
      this.setState((state) => {
        return {count: state.count + i}
      });
    }
  }

  render()
  {
    return(
      <div id="test-a">
        <ul>
          {this.state.count}
        </ul>
        <button ></button>
      </div>
    );
  }
}


export default App;
